INSERT INTO `book` VALUES (1,'Zaigham Mahmood','Cloud Computing',7,7,'Clouds are distributed technology platforms that leverage sophisticated technology innovations to provide highly scalable and resilient environments that can be remotely utilized by organizations in a multitude of powerful ways. To successfully build upon, integrate with, or even create a cloud environment requires an understanding of its common inner mechanics, architectural layers, and models, as well as an understanding of the business and economic factors that result from the adoption and real-world use of cloud-based services.\n\nIn Cloud Computing: Concepts, Technology & Architecture, Thomas Erl, one of the world’s top-selling IT authors, teams up with cloud computing experts and researchers to break down proven and mature cloud computing technologies and practices into a series of well-defined concepts, models, technology mechanisms, and technology architectures, all from an industry-centric and vendor-neutral point of view. In doing so, the book establishes concrete, academic coverage with a focus on structure, clarity, and well-defined building blocks for mainstream cloud computing platforms and solutions.',_binary 'data:image/jpeg;base64,','Cloud Computing: Concepts, Technology & Architecture'),(2,'Perry Lea','Cloud Computing',14,12,'Industries are embracing IoT technologies to improve operational expenses, product life, and people\'s well-being. An architectural guide is needed if you want to traverse the spectrum of technologies needed to build a successful IoT system, whether that\'s a single device or millions of IoT devices.\n\nIoT and Edge Computing for Architects, Second Edition encompasses the entire spectrum of IoT solutions, from IoT sensors to the cloud. It examines modern sensor systems, focusing on their power and functionality. It also looks at communication theory, paying close attention to near-range PAN, including the new Bluetooth® 5.0 specification and mesh networks. Then, the book explores IP-based communication in LAN and WAN, including 802.11ah, 5G LTE cellular, Sigfox, and LoRaWAN. It also explains edge computing, routing and gateways, and their role in fog computing, as well as the messaging protocols of MQTT 5.0 and CoAP.',_binary 'data:image/jpeg;base64,','IoT and Edge Computing for Architects'),(3,' Surbhi Rastogi','Cloud Computing',12,11,'Cloud computing is a technology that allows you to store, access data and programs over the internet instead of the hard drive or a server. In this book, you will gain knowledge about the fundamentals of cloud computing. This book includes a detailed description of the features of the cloud, the importance of cloud in today’s era, and uses of cloud computing.\n\nThis book provides you with a deep knowledge of the basics of cloud computing. You will learn about the characteristics, architecture, and uses and importance of cloud computing. This book also explores the concept of scalability and redundancy regarding cloud computing. You will learn about the various cloud deployment and service models. You will also gain knowledge of virtualization technology. You will also have a guided tour of concepts related to cloud management, data storage and security, and cloud operations and technologies. At the end of the book, you will learn about the advanced concepts of cloud computing and also learn about mobile cloud computing.',_binary 'data:image/jpeg;base64,','Cloud Computing Simplified'),(4,' Kris Jamsa ','Cloud Computing',13,13,'In the past decade, cloud computing and managed infrastructure services have rapidly become the leading model of web hosting. Cloud Computing, Second Edition accounts for the many changes to the then-emerging business model and technology paradigm since the release of the first edition. Readers will learn specifics about software as a service (Saas), platform as a service (Paas), infrastructure as a service (IaaS), server and desktop virtualization, and much more. Each chapter presents a cloud topic, examines the underlying business case, and then takes the reader on a test drive.',_binary 'data:image/jpeg;base64,','Cloud Computing'),(5,'Newton Alex','Data Science',10,10,'Azure is one of the leading cloud providers in the world, providing numerous services for data hosting and data processing. Most of the companies today are either cloud-native or are migrating to the cloud much faster than ever. This has led to an explosion of data engineering jobs, with aspiring and experienced data engineers trying to outshine each other.\n\nGaining the DP-203: Azure Data Engineer Associate certification is a sure-fire way of showing future employers that you have what it takes to become an Azure Data Engineer. This book will help you prepare for the DP-203 examination in a structured way, covering all the topics specified in the syllabus with detailed explanations and exam tips. The book starts by covering the fundamentals of Azure, and then takes the example of a hypothetical company and walks you through the various stages of building data engineering solutions. Throughout the chapters, you\'ll learn about the various Azure components involved in building the data systems and will explore them using a wide range of real-world use cases. Finally, you\'ll work on sample questions and answers to familiarize yourself with the pattern of the exam.',_binary 'data:image/jpeg;base64,','Azure Data Engineer Associate Certification Guide'),(6,'Nick Singh','Data Science',10,9,'201 real Data Science interview questions asked by Facebook, Google, Amazon, Netflix, Two Sigma, Citadel and more — with detailed step-by-step solutions!\nLearn how to break into Data Science, with tips on crafting your resume, creating kick-ass portfolio projects, sending networking cold emails, and better telling your story during behavioral interviews\nQuestions cover the most frequently-tested topics in data interviews: Probability, Statistics, Machine Learning, SQL & Database Design, Coding (Python), Product Analytics, and A/B Testing\nEach chapter has a brief crash-course on the most important concepts and formulas to review\nLearn how to solve open-ended case study questions that combine product-sense, business intuition, and statistical modeling skills, and practice with case interviews from Airbnb, Instagram, & Accenture',_binary 'data:image/jpeg;base64,','Ace the Data Science Interview'),(7,'Lillian Pierson','Data Science',14,14,'Data Science For Dummies demonstrates:\n\nThe only process you’ll ever need to lead profitable data science projects\nSecret, reverse-engineered data monetization tactics that no one’s talking about\nThe shocking truth about how simple natural language processing can be\nHow to beat the crowd of data professionals by cultivating your own unique blend of data science expertise \nWhether you’re new to the data science field or already a decade in, you’re sure to learn something new and incredibly valuable from Data Science For Dummies. Discover how to generate massive business wins from your company’s data by picking up your copy today.',_binary 'data:image/jpeg;base64,','Data Science For Dummies '),(8,'Thomas Nield','Data Science',10,10,'Use Python code and libraries like SymPy, NumPy, and scikit-learn to explore essential mathematical concepts like calculus, linear algebra, statistics, and machine learning\nUnderstand techniques like linear regression, logistic regression, and neural networks in plain English, with minimal mathematical notation and jargon\nPerform descriptive statistics and hypothesis testing on a dataset to interpret p-values and statistical significance\nManipulate vectors and matrices and perform matrix decomposition\nIntegrate and build upon incremental knowledge of calculus, probability, statistics, and linear algebra, and apply it to regression models including neural networks\nNavigate practically through a data science career and avoid common pitfalls, assumptions, and biases while tuning your skill set to stand out in the job market',_binary 'data:image/jpeg;base64,','Essential Math for Data Science'),(9,'Alex J. Gutman','Data Science',25,25,'In Becoming a Data Head: How to Think, Speak, and Understand Data Science, Statistics, and Machine Learning, award-winning data scientists Alex Gutman and Jordan Goldmeier pull back the curtain on data science and give you the language and tools necessary to talk and think critically about it.\n\nYou\'ll learn how to:\n\nThink statistically and understand the role variation plays in your life and decision making\nSpeak intelligently and ask the right questions about the statistics and results you encounter in the workplace\nUnderstand what\'s really going on with machine learning, text analytics, deep learning, and artificial intelligence\nAvoid common pitfalls when working with and interpreting data',_binary 'data:image/jpeg;base64,','Becoming a Data Head'),(10,'Ben Piper','IT Operations',27,27,'The AWS Certified Solutions Architect Study Guide: Associate (SAA-C03) Exam, 4th Edition comprehensively and effectively prepares you for the challenging SAA-C03 Exam. This Study Guide contains efficient and accurate study tools that will help you succeed on the exam. It offers access to the Sybex online learning environment and test bank, containing hundreds of test questions, bonus practice exams, a glossary of key terms, and electronic flashcards.\n\nIn this complete and authoritative exam prep blueprint, Ben Piper and David Clinton show you how to:\n\nDesign resilient AWS architectures\nCreate high-performing solutions\nCraft secure applications and architectures\nDesign inexpensive and cost-optimized architectures\nAn essential resource for anyone trying to start a new career as an Amazon Web Services cloud solutions architect, the AWS Certified Solutions Architect Study Guide: Associate (SAA-C03) Exam, 4th Edition will also prove invaluable to currently practicing AWS professionals looking to brush up on the fundamentals of their work.',_binary 'data:image/jpeg;base64,','AWS Certified Solutions Architect Study Guide with 900 Practice Test Questions'),(11,'SK Shingh','IT Operations',12,12,'To make understanding the subject a smoother experience, the book is divided into the following sections:\nCloud Computing\nAWS Fundamentals (What is AWS, AWS Account, AWS Free Tier, AWS Cost & Billing Management, AWS Global Cloud Infrastructure (part I)), IAM, EC2)\nAWS Advanced (EC2 Advanced, ELB, Advanced S3, Route 53, AWS Global Cloud Infrastructure (part II), Advanced Storage on AWS, AWS Monitoring, Audit, and Performance),\nAWS RDS and Databases (AWS RDS and Cache, AWS Databases)\nServerless (Serverless Computing, AWS Integration, and Messaging)\nContainer & CI/CD (Container, AWS CI/CD services)\nData & Analytics (Data & Analytics)\nMachine Learning (AWS ML/AI Services)\nSecurity (AWS Security & Encryption, AWS Shared Responsibility Model, How to get Support on AWS, Advanced Identity)\nNetworking (AWS Networking)\nDisaster Management (Backup, Recovery & Migrations)\nSolutions Architecture (Cloud Architecture Key Design Principles, AWS Well-Architected Framework, Classic Solutions Architecture)',_binary 'data:image/jpeg;base64,','AWS Ultimate Guide'),(13,'Herbert Schildt','Development',12,12,'Fully updated for Java SE 17, Java™: The Complete Reference, Twelfth Edition explains how to develop, compile, debug, and run Java programs. Best-selling programming author Herb Schildt covers the entire Java language, including its syntax, keywords, and fundamental programming principles.',_binary 'data:image/jpeg;base64,','Java: The Complete Reference, Twelfth Edition'),(14,' Devlin Basilan Duldulao','Development',15,15,'Angular makes building applications with the web easy and Spring Boot helps get an application up and running using just a few lines of code and minimal configuration. This book provides insights into building full-stack apps using Angular and Spring Boot effectively to reduce overall development time and increase efficiency.',_binary 'data:image/jpeg;base64,','Spring Boot and Angular'),(15,' AMZ Press','Development',5,5,'Guido van Rossum was given the title of “Benevolent dictator for life” by the members of the Python community to honor him for his long-term dedication and commitment to the project and for being the project leader for such an extended period.\n\nThe programming language was named “Python” because Guido van Rossum liked a BBC comedy series called \"Monty Python\'s Flying Circus\". He wanted the name to be short, unique, and slightly mysterious, thus ending up the programming language “Python”.',_binary 'data:image/jpeg;base64,','Python Programming for Beginners'),(16,' Code Quickly','Development',7,7,'Developers and programmers are amongst the highest paid professions in the world, and according to the US Bureau of Labor Statistics, the number of jobs for software and app developers will increase by a shocking 24% in the next few years.\n\nIn 2019, the tech industry posted 4.6 million job openings in the US job market, and their direct economic output was estimated at 1.9 trillion dollars.',_binary 'data:image/jpeg;base64,','Learn JavaScript Quickly'),(17,' Mario Casciaro','Development',5,5,'Throughout the book, you\'ll see Node.js in action with the help of several real-life examples leveraging technologies such as LevelDB, Redis, RabbitMQ, ZeroMQ, and many others. They will be used to demonstrate a pattern or technique, but they will also give you a great introduction to the Node.js ecosystem and its set of solutions.',_binary 'data:image/jpeg;base64,','Node.js Design Patterns');
