INSERT INTO `review` VALUES (1,1,'mina_92@gmail.com',4,' Professional level, well written','This book is amazing, in depth and super informative. If you really into nodejs you have to grab this book as soon as possible.','2023-02-13 10:43:23.242000'),(2,2,'mina_92@gmail.com',5,'Clean and well structured','This book gets straight to the point, and there are many practical examples.\nYou can find fundamentals and more advanced notions.\nEach chapter is well designed and the presentation of topics follows a well-structured logic.','2023-02-13 10:53:40.732000'),(3,6,'mina_92@gmail.com',3,' i thought i knew node until i stumbled upon this book.','one con: would be much more powerful, had it be written in typescript i think.','2023-02-13 10:54:32.486000'),(4,3,'triquang@gmail.com',4,' A bit hard to follow','I find that it takes intense reading of each page to grasp the point of what is being said. Not for beginners. You could be relatively new to NodeJS but would need to be familiar with programming in a different language to derive value from this book.','2023-02-13 11:07:48.139000'),(5,1,'triquang@gmail.com',5,' Remarkably good. At least for me.','I\'ve been writing node for years, but it\'s changed in the past few years, and I haven\'t kept up. Also, a lot of stuff I and my colleagues have written i would class as \"amateur\" or \"garage shop.\" (sorry, colleagues)\n\nNow that\'s I\'ve been through this book, (actually, not finished yet) I feel that I know how node programs can fit into an ecosystem, and not surprise my clients. (Meaning human business people, not programs.)\n','2023-02-13 11:08:14.291000'),(6,2,'triquang@gmail.com',3,'Excellent hands-on intro to backend development','This book provides an excellent hands-on introduction to backend, distributed-systems development. Although many of the examples are built around simple Node.js servers, the book is mostly about distributed systems more broadly. Anyone wishing to gain a solid understanding of backend systems development would do well to read this book, even if their preferred stack didn\'t include Node.js.','2023-02-13 11:09:13.846000');
